import { z } from 'zod';

export const zTalent = z.object({
   id: z.number(),
   name: z.string(),
   description: z.string(),
   edges: z.array(z.number()),
   x: z.number(),
   y: z.number(),
   type: z.union([z.literal('small'), z.literal('large')]).optional(),
});

export type Talent = z.infer<typeof zTalent>;

